import React, { Component } from 'react';
import './App.css';
import Particles from 'react-particles-js';

class App extends Component {
  render() {
    return (
      <div className="App">
      <Particles className='parti'
    params={{
        particles: {
          number:{
            value:40,
            density:{
              enable:true,
              value_area:800
            }
          },
         move:
         {
           enable:true,
           speed:7
         },

        }
      }}/>

      </div>
    );
  }
}

export default App;
